import { StyleSheet } from 'react-native';

export default StyleSheet.create(
    {
        container: {
            flex: 1,
            backgroundColor: '#C542F5',
            alignItems: 'center',
            justifyContent: 'center'
        },
        title:{
            color: '#F5D142',
            fontSize: '1.5rem',
            fontWeight: 'bold'
        }
    }
);
